function [F,G,H] = costFunctionCameraResectioning(params,X,Y,Z,x,y)
% Cost function for camera resectioning using geometric error.

doDisplay = 0;
if doDisplay
  DisplayPoints(params,X,Y,Z,x,y);
  pause;
end

f = params(1); px = params(2); py = params(3);
w1 = params(4); w2 = params(5); w3 = params(6);
cx = params(7); cy = params(8); cz = params(9);

F = sum(Cost(X,Y,Z,cx,cy,cz,f,px,py,w1,w2,w3,x,y));
if nargout >= 2
  G = sum(Grad(X,Y,Z,cx,cy,cz,f,px,py,w1,w2,w3,x,y),2);
end
if nargout >= 3
  H = Hess(X,Y,Z,cx,cy,cz,f,px,py,w1,w2,w3,x,y);
% $$$   [u,d,v] = svd(H);
% $$$   display([max(diag(d)) min(diag(d))]);
end

function DisplayPoints(params,X,Y,Z,x,y)
paramsOpt = params;

wOpt = paramsOpt(4:6);
angOpt = sqrt(sum(wOpt.^2));
nOpt = wOpt/angOpt;
N = [0 -nOpt(3) nOpt(2); nOpt(3) 0 -nOpt(1); -nOpt(2) nOpt(1) 0];
P = [paramsOpt(1) 0 paramsOpt(2); 0 paramsOpt(1) paramsOpt(3); 0 0 1]*(eye(3) + sin(angOpt)*N + (1-cos(angOpt))*N*N)*[eye(3) -paramsOpt(7:9)'];
xx = P*[X; Y; Z; ones(1,length(X))];
xx = [xx(1,:)./xx(3,:); xx(2,:)./xx(3,:)];

clf;
plot(xx(1,:),xx(2,:),'r+');
hold on;
plot(x,y,'bo');
% $$$ axis ij;
drawnow;
title(sprintf('Focal: %0.2f',paramsOpt(1)));
legend('Projected points','Hand-clicked points');

